import React from 'react'
import { StyleSheet, Text, View , Image } from 'react-native'
import HeaderInfo from "../../components/HeaderInfo"



const Home = () => {
    return (
        <View style={styles.container}>
          <View style={styles.wrapper}>
            <HeaderInfo />
              <View style={styles.promo}>
                <Image source={require('./Banner.png')} style={{width :350 , height : 100}} />
              </View>

            <Text >Ayo <Text style={styles.maintext}>Main Futsal</Text></Text>
          </View>
        </View>
    )
}

export default Home

const styles = StyleSheet.create({
  container : {
    flex : 1 ,
    backgroundColor : '#fff2ff' 
  } ,
  wrapper : {
    paddingHorizontal : 30 ,
    paddingTop : 30 
  } ,
  promo : {
    display : 'flex',
    flexDirection : 'row' ,
    marginTop : 20 ,
    marginLeft : 0 ,
    justifyContent : 'center'

  } , 
  maintext : {
    fontWeight : 'bold'
  }
})
